window.bookSummaryJSON = "<p>When Grace Andreas's sister, Petra, and her husband are both killed, Grace inherits the power and responsibilities of the Oracle of Louisville, as well as her sister's two young children - neither of which she is prepared for. Then Khalil, Demonkind and Djinn prince of House Marid, decides to make himself a part of the household, both as guardian and counterpoint to Grace's impudence towards the Elder Races. </p>"; 
